def isValid(s):
    # create a hashmap of the number of times letters occur
    mapS = {}

    # populate hashmap with letters
    for i in range(len(s)):
        # check if letter is in hashmap
        if s[i] in mapS:
            # letter is already in hashmap
            mapS[s[i]] += 1
        else:
            mapS[s[i]] = 1

    numOfOcc = None
    hasOneMore = False

    for key in mapS:
        #default case
        if numOfOcc is None:
            numOfOcc = mapS[key]
        else:
            #if it is only one more
            if numOfOcc -1 == mapS[key]:
                #check if hasOneMore
                if hasOneMore:
                    return "NO"
                else:
                    hasOneMore = True
            #if its less than
            elif numOfOcc < mapS[key]:
                #check if hasOneMOre
                if hasOneMore:
                    return "NO"
                else:
                    hasOneMore = True
            #if its more than one more
            elif numOfOcc -1 > mapS[key]:
                #check if there was already one.
                if hasOneMore or mapS[key] > 1:
                    return "NO"
                else:
                    hasOneMore = True

    return "YES"





print(isValid(""))